import React from "react";
import plate2 from './imgs/plate2.svg'

const ReadyToCock =() =>{
    return (
        <div class="md:h-[40vh] lg:h-[70vh] h-[30%] mt-12 w-[96%] ml-[2%] pt-10">
            <div clas="w-[50%]">
                <img src={plate2} class="w-full h-full"></img>
            </div>
            <div clas="w-[50%]">

            </div>
        </div>
    )
}
export default ReadyToCock;
